  return (
    <div className="p-6 max-w-3xl mx-auto">
      <h2 className="text-3xl font-bold mb-6">Music Projects</h2>
      <p className="text-lg text-gray-700 mb-4">I write and perform indie rock music as solo and band.</p>
      <ul className="list-disc pl-6 text-gray-700 mb-6">
        <li>üéµ "Psychedelic Disco - A Flowing Life" ‚Äì EP album by solo "Nam Heeon"</li>
        <li>üéµ "Freedom" ‚Äì Full album in production (10 songs) by solo "Nam Heeon"</li>
        <li>üéµ "Wooyadongdong" ‚Äì Solo album by band "Oyan"</li>
        <li>üé∏ preparing the Full album and a show at Rolling Hall, Nov 1st by band "Oyan"</li>
        <li>üé∏ preparing new band</li>
      </ul>
      <Link to="/" className="text-blue-500 hover:underline">‚Üê Back to Home</Link>
    </div>
  );
}
